import {produce} from 'immer'

export const InitialStateS={


}

export const datareducerS=produce((state,action)=>{
    switch(action.type){
        case "SET_MAN":state.isManager=action.payload
         case "SET_USERNAME": state.userName=action.payload  
        
        default:
            break;
    }
},InitialStateS)
